{"1": ["Пришла цепочка с браком, растроились!", "2020-05-12T10:49:28.523998341Z", "серебристый", "60", 0, 1, 1, "Цепочка", "Бронницкий ювелир"], "3": ["Чуть шире чем 1мм, выглядит прочно, посмотрим как будет в использовании", "2020-05-08T17:21:06.1216099Z", "серебристый", "60", 3, 0, 5, "Цепочка", "Бронницкий ювелир"], "4": ["Красивая,но пришла с браком ...узелок с заломом у кольца...", "2020-02-18T17:33:15.721681697Z", "серебристый", "40", 2, 0, 3, "Цепочка", "Бронницкий ювелир"], "5": ["Цепочка красивая и плетение соответствует фотографии. Но для меня очень  тоненькая, так что возврат...", "2020-02-10T19:33:03.647362951Z", "серебристый", "50", 0, 1, 5, "Цепочка", "Бронницкий ювелир"], "6": ["Красивая цепочка,брала для крестика и иконки.Всем довольна.Спасибо магазину и производителю и WB.", "2020-01-17T14:01:46.425113731Z", "серебристый", "65", 1, 0, 5, "Цепочка", "Бронницкий ювелир"], "7": ["Тонкая серая нитка ,может родиевая хоть блестели бы , а так брошенные деньги.", "2019-12-22T20:07:31.650852452Z", "серебристый", "50", 1, 6, 2, "Цепочка", "Бронницкий ювелир"], "8": ["И недели не прошло, по чернела и порвалась!", "2019-07-19T07:09:43.329470542Z", "серебристый", "40", 4, 1, 1, "Цепочка", "Бронницкий ювелир"], "9": ["Порвалась на следующей день  после  покупки.брак, возрат  невозможно .телефона  нет,позвонить  некуда !все общение с роботомботом  в вабейре. Компания полный   отстой.", "2018-03-28T16:57:22.858+03:00", "серебристый", "45", 11, 7, 1, "Цепочка", "Бронницкий ювелир"], "10": ["Отличная цепочка, мне нужно было под крестик, она как раз тонкая и изящная. Но колечки действительно кажутся очень хрупкими, посмотрим, долго ли прослужит. ", "2018-02-22T09:30:30.604+03:00", "серебристый", "45", 3, 2, 5, "Цепочка", "Бронницкий ювелир"], "11": ["Цепочка красивая, но кольца на застежке действительно тонкие, серебро темное. плетение понравилось поэтому взяла. Две. К большому сожалению обе порвались через неделю носки", "2016-12-25T09:25:20+03:00", "серебристый", "40", 19, 2, 2, "Цепочка", "Бронницкий ювелир"], "12": ["Плетение красивое, на вид прочная, но она темнее чем на фото, а нужна была именно светлая.", "2016-11-15T00:04:16+03:00", "серебристый", "65", 1, 0, 5, "Цепочка", "Бронницкий ювелир"], "13": ["Цепочка сначала очень понравилась, и необычное плетение, и цвет настоящего серебра. Но через месяц носки она развалилась на куски, как сгнила. Возможно ее нельзя мочить.(((", "2016-07-04T13:13:47+03:00", "серебристый", "50", 25, 0, 3, "Цепочка", "Бронницкий ювелир"], "14": ["Цепочка понравилась. Тоненькая и милая, под маленькую подвеску. Плетение необычное и красивое. Смутили просто крошечные и тонюсенькие кольца у застежки, вот зачем такие делать... Повторно не рискну заказать. В размере 55 вес 2,89  грамм.", "2016-06-28T17:32:01+03:00", "серебристый", "55", 2, 0, 4, "Цепочка", "Бронницкий ювелир"], "15": ["тоненькая цепочка, не блестит, купила за 300 рублей.", "2016-05-10T15:25:35+03:00", "серебристый", "50", 7, 0, 4, "Цепочка", "Бронницкий ювелир"], "16": ["... и уже порвалась", "2016-06-22T09:38:21+03:00", "серебристый", "50", 3, 0, 1, "Цепочка", "Бронницкий ювелир"], "17": ["Изящная, красивая цепочка. Очень интересное плетение - ни разу такого не встречала. В носке два месяца. Не темнеет, замок работает как следует.", "2016-04-22T14:41:05+03:00", "серебристый", "50", 4, 0, 5, "Цепочка", "Бронницкий ювелир"], "18": ["цепочка плохая, курьер уехал и она оборвалась, очень жаль выкинутых денег", "2015-06-22T10:38:02+03:00", "серебристый", "", 12, 6, 1, "Цепочка", "Бронницкий ювелир"], "19": ["Цепочка понравилась. Взяла под легкую летнюю подвеску. Лёгкая приятная.", "2015-06-20T22:58:46+03:00", "серебристый", "", 4, 1, 5, "Цепочка", "Бронницкий ювелир"], "20": ["Очень быстро порвалась!!! При ее ремонте нам сказали что качество у цепочки плохое. Не советую", "2015-05-17T23:45:34+03:00", "серебристый", "", 25, 0, 1, "Цепочка", "Бронницкий ювелир"], "21": ["Взяла сынули под крестик. Ходим не первую неделю и не нарадуемся, так как предыдущую цепь плоского плетения он порвал через две недели, а этой хоть бы что. Тонкая и не блестящая - самое  оно для ребенка.", "2015-05-06T20:41:09+03:00", "серебристый", "", 4, 0, 5, "Цепочка", "Бронницкий ювелир"], "22": ["Цепочка понравилась. Плетение интересное. По оттенку цвет между черненым и родированым серебром, универсальный.", "2015-04-28T13:58:36+03:00", "серебристый", "", 5, 1, 5, "Цепочка", "Бронницкий ювелир"], "23": ["Купила цепочки детям, на вид красивые, но порвались очень быстро, буквально через несколько дней, слишком тоненькие. Очень жаль, деньги на ветер.", "2015-04-09T22:02:35+03:00", "серебристый", "", 24, 2, 3, "Цепочка", "Бронницкий ювелир"], "24": ["Цепочка прочная, качественная. Но простоватая на девочку подростка, тонкая и не блестит. Отказ в пользу другой.", "2015-03-27T22:36:46+03:00", "серебристый", "", 7, 1, 4, "Цепочка", "Бронницкий ювелир"], "25": ["Взяли малышу для крестика,то что нужно- коротенькая,хорошее прочное плетение,нет сомнений в качестве и подлинности изделия.Спасибо любимому магазину за реализацию теперь и ювелирных изделий!", "2015-01-30T18:47:37+03:00", "серебристый", "", 7, 3, 5, "Цепочка", "Бронницкий ювелир"]}
